import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="app-wrap">
      <header className="header">
        <img src="https://upload.wikimedia.org/wikipedia/commons/b/be/Lineage_OS_Logo.png" alt="" />
      </header>
      <nav className="nav">
        <div>Prof</div>
        <div>Mess</div>
        <div></div>
        <div></div>
      </nav>
      <article className="article">
        <div></div>
      </article>
    </div>
  );
}


export default App;
